// HomePage.js
import React from 'react';
import Box from '@mui/material/Box';
import Typography from '@mui/material/Typography';

const HomePage = () => {
  return (
    <Box
      sx={{
        position: 'relative',
        minHeight: '100vh',
        overflow: 'hidden',
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center', // Align content to the center vertically
        background: 'linear-gradient(to right, #311b92, #6200ea)', // Set the background color for the 3D effect layer
      }}
    >
      {/* Card-like square with 3D effect */}
      <Box
        sx={{
          width: '60%',
          height: '60vh',
          borderRadius: '16px', // Rounded corners for a card-like appearance
          overflow: 'hidden',
          background: 'linear-gradient(to right, #311b92, #6200ea)', // Gradient of black and purple
          boxShadow: '10px 10px 20px rgba(0, 0, 0, 0.2)', // 3D effect using box-shadow
          position: 'relative', // Ensure relative positioning for z-index to work
          zIndex: 1, // Ensure the card is above the background layer
        }}
      >
        {/* Image on the top right corner */}
        <img
          src='C:\Windows\System32\design-boost\src\images\image-removebg-preview (90).png' // Replace with the path to your image
          alt='Top Right Image'
          style={{
            position: 'absolute',
            top: '10px',
            right: '10px',
            width: '100px', // Adjust the width as needed
            height: 'auto', // Maintain aspect ratio
            borderRadius: '8px', // Optional: Rounded corners for the image
          }}
        />

        {/* Image on the left bottom corner */}
        <img
          src='C:\Windows\System32\design-boost\src\images\image-removebg-preview (91).png' // Replace with the path to your image
          alt='Left Bottom Image'
          style={{
            position: 'absolute',
            bottom: '10px',
            left: '10px',
            width: '100px', // Adjust the width as needed
            height: 'auto', // Maintain aspect ratio
            borderRadius: '8px', // Optional: Rounded corners for the image
          }}
        />

        {/* Content inside the card */}
        <Box
          sx={{
            display: 'flex',
            justifyContent: 'space-between', // Distribute content
            alignItems: 'center', // Align content vertically
            padding: '40px',
            color: 'white',
          }}
        >
          <Box sx={{ flexGrow: 1 }}>
            <Typography variant='h3' fontWeight={700} fontFamily='Roboto'>
              Elevate Your Designs with Design Boost
            </Typography>
            <Typography variant='subtitle1' mt={2}>
              Unleash the power of stunning and user-friendly interfaces.
            </Typography>
          </Box>
        </Box>
      </Box>
    </Box>
  );
};

export default HomePage;
